import React from 'react';
import './contact.scss';
import Label from './../label/label';

function Contact() {
    return (
        <div className="contact">
            <div className="contact__title">
                <span>Project?</span>
                <span>Qustions?</span>
            </div>
            <div className="contact__text">
                <span>Send us an e-mail or use the form.</span>
                <a href="mailto:contact@meijer.com" className="contact__text__email">contact@meijer.com</a>
            </div>
            <form className="contact__form" action="#">
                <Label classNameAdded="contact__form__name" placeHolder="Name" />
                <Label classNameAdded="contact__form__company" placeHolder="Company" />
                <Label classNameAdded="contact__form__email" placeHolder="Email" />
                <Label classNameAdded="contact__form__phone" placeHolder="Phone" />
                <div className="contact__form__submit">
                    <span className="contact__form__submit__button">Submit</span>
                </div>
                <div className="contact__form__error-message"><span>One or more fields have an error. Please check and try
                    again.</span>
                </div>
            </form>
        </div>
    );
}

export default Contact;
